import React from "react";
import SongList from "./Component/SongList";
import SongDetail from "./Component/SongDetail";

const App = () => {
  return (
    <div className="container fontifyr">
      <div className="row">
        <div className="col-5">
          <SongList />
        </div>
        <div className="col">
            <SongDetail/>
        </div>
      </div>
    </div>
  );
};

export default App;
